import{_ as e,o as t,c as o,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 29.1-303 Fees to hunt.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/29.1-303.md","filePath":"vacode/29.1-303.md"}'),n={name:"vacode/29.1-303.md"},r=a('<h1 id="§-29-1-303-fees-to-hunt" tabindex="-1">§ 29.1-303 Fees to hunt. <a class="header-anchor" href="#§-29-1-303-fees-to-hunt" aria-label="Permalink to &quot;§ 29.1-303 Fees to hunt.&quot;">​</a></h1><p>The license fees to hunt shall be as follows or as such fees may be subsequently revised by the Board pursuant to § <a href="http://law.lis.virginia.gov/vacode/29.1-103/" target="_blank" rel="noreferrer">29.1-103</a>:</p><ol><li><p>County or city resident license to hunt in the county or city of residence only, $5.</p></li><li><p>State resident license to hunt in all counties and cities of the Commonwealth, issued to residents age 16 or older, $12.</p></li><li><p>State nonresident license for persons 16 years of age and older to hunt in all counties and cities of the Commonwealth, $80; however, for (i) nonresidents under the age of 12, $12, and (ii) nonresidents 12 years of age to 15 years of age, $15.</p></li></ol><p>Code 1950, § 29-54; 1960, c. 566; 1974, c. 363; 1980, c. 494; 1987, c. 488; 1988, c. 250; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0120" target="_blank" rel="noreferrer">120</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0269" target="_blank" rel="noreferrer">269</a>; 2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0009" target="_blank" rel="noreferrer">9</a>.</p>',4),i=[r];function s(l,c,h,d,f,_){return t(),o("div",null,i)}const g=e(n,[["render",s]]);export{u as __pageData,g as default};
